If you want to iterate over something in Rust, you might write the following: let v = vec![1, 2, 3];
for elem in v.iter() { ... } The iter method returns an iterator of references into the items in the vector. Conceptually, it looks something like this (the actual implementation works differently): impl<T> Vec<T> { fn iter<'a>(&'a self) -> Iter<'a, T> { Iter { vec: self, position: 0 } }
} where Iter is a struct that implements the Iterator trait: pub struct Iter<'a, T> { vec: &'a Vec<T>, position: usize,
} impl<'a, T> Iterator for Iter<'a, T> { type Item = &'a T; fn next(&mut self) -> Option<&'a T> { let i = self.position; if i < self.vec.len() { self.position += 1; Some(&self.vec[i]) } else { None } }
} Rust's other collections also have similar iter methods that work the same way. You might wonder, why not have an Iterable trait, that encapsulates this pattern? Something like this: trait Iterable { type Item; type Iterator: Iterator<Item = Self::Item>; fn iter<'a>(&'a self) -> Self::Iterator;
} Well, if you look closely at this trait, you'll see that it does't work. The type that an impl needs to provide for Iterator needs to be able to reference 'a, the lifetime of the self parameter. But currently, it can't! That lifetime is not in scope: impl<T> Iterable for Vec<T> { type Item = &'a T; // ^^ 'a is not in scope here! type Iterator = Iter<'a, T>; // ^^ 'a is not in scope here! fn iter<'a>(&'a self) -> Iter<'a, T> { Iter { vec: self, position: 0 } }
}

