nightly seeking-feedback We are actively soliciting feedback on the design of this aspect of GATs. This section explains the current nightly behavior, but at the end there is note about the behavior we expect to adopt in the future. A common use for GATs is to represent the lifetime of data that is borrowed from a value of type Self, or some other parameter. Consider the iter method of the Iterable trait: trait Iterable { ... fn iter<'a>(&'a self) -> Self::Iterator<'a>;
} Here, the argument 'a that is given to Self::Iterator represents the lifetime of the self reference. However, by default, there is nothing in the definition of the Iterator associated type that links its lifetime argument and the Self type: // Warning: For reasons we are in the midst of explaining,
// this version of the trait will not compile.
trait Iterable { type Item<'me>; type Iterator<'me>: Iterator<Item = Self::Item<'me>>; fn iter<'a>(&'a self) -> Self::Iterator<'a>;
} If you try to compile this trait, you will find that you get an error. To make it compile, you have to indicate the link between 'me and Self by adding where Self: 'me. This outlives bound indicates the GATs can only be used with a lifetime 'me that could legally be used to borrow Self. This version compiles: trait Iterable { type Item<'me> where Self: 'me; type Iterator<'me>: Iterator<Item = Self::Item<'me>> where Self: 'me; fn iter<'a>(&'a self) -> Self::Iterator<'a>;
}

