Without these bounds, users of the trait would almost certainly not be able to write the impls that they need to write. Consider an implementation of Iterable for Vec<T>, assuming that there are no where Self: 'me bounds on the GATs: impl Iterable for Vec<T> { type Item<'me> = &'me T; type Iterator<'me> = std::vec::Iter<'me, T>; fn iter(&self) -> Self::Iterator<'_> { self.iter() }
} The problem comes from the associated types. Consider the type Item<'me> = &'me T declaration, for example: for the type &'me T to be legal, we must know that T: 'me. Otherwise, nothing stops us from using Self::Item<'static> to construct a reference with a lietime 'static that may outlive its referent T, and that can lead to unsoundness in the type system. In the case of the iter method, the fact that it takes a parameter self of type &'me Vec<T> already implies that T: 'me (otherwise that parameter would have an invalid type). However, that doesn't apply to the GAT Item. This is why the associated types need a where clause: impl Iterable for Vec<T> { type Item<'me> = &'me T where Self: 'me; type Iterator<'me> = std::vec::Iter<'me, T> where Self: 'me; fn iter(&self) -> Self::Iterator<'_> { self.iter() }
} However, this impl is not legal unless the trait also has a where Self: 'me requirement. Otherwise, the impl has more where clauses than the trait, and that causes a problem for generic users that don't know which impl they are using.

