Analyze the types of methods within the trait definition. It a GAT is applied to a lifetime 'x, examine the implied bounds of the method for bounds of the form T: 'x, where T is an input parameter to the trait. If we find such bounds on all methods for every use of the GAT, then add the corresponding default. Consider the LendingIterator trait: trait LendingIterator { type Item<'a>; fn next<'b>(&'b mut self) -> Self::Item<'b>;
} Analyzing the closure body, we see that it contains Self::Item<'b> where 'b is the lifetime of the self reference (e.g., self: &'b Self or self: &'b mut Self). The implied bounds of this method contain Self: 'b. Since there is only one use of Self::Item<'b>, and the implied bound Self: 'b applies in that case, then we add the default where Self: 'a to the GAT. This check is a fairly simple syntactic check, though not necessarily easy to explain. It would accept all the examples that appear in this document, including the example with fn default() -> Self::Data<'static> (in that case, the default is not triggered, because we found a use of Data that is applied to a lifetime for which no implied bound applies). The only case where this default behaves incorrectly is the case where all uses of Self::Data that appear within the trait need the default, but there are uses outside the trait that do not (I couldn't come up with a realistic example of how to do this usefully). Extending to other type parameters The inference can be extended naturally beyond self to other type parameters. Therefore this example: trait Parser<Input> { type Output<'i>; fn get<'input>(&mut self, i: &'input Input) -> Self::Output<'input>;
} would infer a where Input: 'i bound on type Output<'i>. Similarly: trait Parser<Input> { type Output<'i>; fn get(&mut self, i: &'input Input) -> Self::Output<'input>;
} would infer a where Input: 'i bound on type Output<'i>. Avoiding the default If this default is truly not desired, there is a workaround: one can declare a supertrait that contains just the associated type. For example: trait IterType { type Iter<'b>;
} trait LendingIterator: IterType { fn next(&mut self) -> Self::Iter<'_>;
} This workaround is not especially obvious, however. Related precedent We used to require T: 'a bounds in structs: struct Foo<'a, T> { x: &'a T
} but as of RFC 2093 we infer such bounds from the fields in the struct body. In this case, if we do come up with a default rule, we are essentially inferring the presence of such bounds by usages of the associated type within the trait definition.

